import React, { useState } from "react";

import Quiz from "./Quiz";

import style from "./style.module.css";

function App() {
  const [started, markStarted] = useState(false);

  function startQuiz() {
    markStarted(true);
  }

  return started ? (
    <Quiz></Quiz>
  ) : (
    <div>
      <h4>THE ULTIMATE</h4>
      <h1>TAYLOR SWIFT BRIDGE</h1>
      <h3>LYRICS QUIZ</h3>
      <button onClick={startQuiz}>START</button>
    </div>
  );
}

export default App;
